    false,nt"url": null,nt"notes": "This annual narrative report for Izembek
    National Wildlife Refuge (including Izembek, Pavlof, and Unimak Units) outlines
    Refuge accomplishments during the 1989 calendar year. The report begins with a summary
    of the year's highlights and weather conditions. Land acquisition is covered. The
    report includes a planning section which discusses the master plan and research
    and investigations. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, pest control,
    and wilderness areas. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, marine mammals, fisheries resources, scientific collections,
    and marking and bird banding. The public uses of the Refuge described in this report
    include interpretive programs, hunting, fishing, trapping, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, computer systems, and energy conservation.
    Cooperative programs, economic uses of the Refuge, and items of interest are provided
    at the end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
